.if TARGET_A3X

	.org 0x20000

	.global FFEntry
	.global VBlankHandler
	.global HBlankHandler
	.global AnalogRead
	.global AnalogSelect
	.global DigitalRead
	.global Objects
	.global Palette
	.global ProgramRam
	.extern OnPlayfieldWrite
	.extern OnVBlank

	MEM_IO = 0x0D000000
	REG_LINE = MEM_IO + 0x0002

| Safely calls out to C while preserving volatile registers
.macro CallOnPlayfieldWrite address, value
	movem.l %D0-%D1/%A0-%A1, -(%A7)
	move.l  \value, -(%A7)
	move.l  \address, -(%A7)
	jsr     OnPlayfieldWrite
	addq.l  #8, %A7
	movem.l (%A7)+, %D0-%D1/%A0-%A1
.endm

| Runs before playfield writes
Detour_0396:
	CallOnPlayfieldWrite %A0, %D1
	move.w  %D1, (%A0)
	addq.w  #1, %D7
	jmp     ROM+0x32e

| Runs before playfield writes
Detour_3D98:
	CallOnPlayfieldWrite %A5, %D0
	move.w  %D0, (%A5)
	tst.l   (%A7)+
	movem.l (%A7)+, %D4-%D7/%A5
	jmp     ROM+0x3da0

| Called after the game's VBlank handler updates the palette and
| sprites but before it polls input and retores the previous SR.
Trampoline_7468:
	jsr     OnVBlank
	jmp     ROM+0x7468

| BIOS interface VBlank handler
VBlankHandler:
	| Re-register the HBlank handler
	movea.l interface, %A0
	move.l  #HBlankHandler, (0x10,%A0)
	| Load exception frame pointer
	movea.l (0x4,%A7), %A0
	| Push SR onto the stack (along with half of PC, but we don't care)
	move.l  (0x0,%A0), -(%A7)
	jsr     FFVBlankHandler
	addq.l  #4, %A7
	rts

| BIOS interface HBlank handler
HBlankHandler:
	move.w  TargetLine, %D0
	cmp.w   REG_LINE, %D0
	| If target > current, nothing to do
	bgt.b   2f
	addi.w  #128, %D0
	cmpi.w  #384, %D0
	| If target <= 384, just schedule next target
	ble.b   1f
	| Otherwise, zero the target for the next frame and unset ourself.
	| The latter step is important so that the VBlank handler doesn't
	| run nested from the HBlank handler before it can return at the
	| end of the last visible line. The game's VBlank handler tries
	| to restore the prior interrupt mask before completing its work.
	| By unsetting ourself we ensure the BIOS HBlank handler returns
	| quickly enough to be done before VBlank fires.
	moveq   #0, %D0
	movea.l interface, %A0
	move.l  %D0, (0x10,%A0)
1:	move.w  %D0, TargetLine
	jsr     FFScanlineHandler
2:	rts

	.section .bss
	.align  0x1000

| Note: these are intentionally ordered from largest to smallest to
| preserve alignment. Consider additional alignment directives if you
| want to reorder these. Actual alignment requirements are unknown.
ProgramRam:
	.space  0x2000
Playfield:
	.space  0x800
NVRam:
	.space  0x200
Palette:
	.space  256 * 2
Objects:
	.space  64 * 4
| The distance between the read and write address must fit in 16 bits
Pokey1Read:
	.space  0x20
| These 3 must be evenly spaced for address calculations to work out
Pokey2:
	.space  0x20
Pokey1:
	.space  0x20
Pokey3:
	.space  0x20

| Various registers
AnalogRead:
	.short  0
AnalogSelect:
	.short  0, 0, 0, 0
DigitalRead:
	.short  0
DigitalWrite:
	.short  0
Unknown:
	.short  0
NVRamRecall:
	.short  0
Watchdog:
	.short  0

| Used by our HBlank handler to simulate interrupts every N lines, as
| on the original arcade hardware.
TargetLine:
	.short  0

.endif
